import React from 'react'
import { Routes, Route } from 'react-router-dom'
//import {Restaurant} from './component/Basics/restaurant'; if u r using export const restaurant in restaurant.js
import Header from './component/Basics/header';

import Boxoffice from './component/Basics/Boxoffice';

import Navbar from './component/Basics/navrbar';



const App = () => {

  return (
    <>

      <Routes>
        <Route path="/" element={<Header />} />


        <Route path="/about" element={<Boxoffice/>}/>

        <Route path="/register" element={<Navbar />}/>



      </Routes>
    </>



  )
}

export default App;
